DROP PROCEDURE IF EXISTS `getCustomerLevel`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `getCustomerLevel` (IN `_CustomerId_param` INT)  BEGIN

	SET @AOV_all = 
	(
        SELECT 
            Format(SUM(OrderDetails.Sale) / COUNT(Orders.POS_OrderKey),0) as aov_all
        FROM Customers
        LEFT JOIN Orders
        ON Customers.CustomerId = Orders.CustomerId
        LEFT JOIN OrderDetails
        ON Orders.POS_OrderKey = OrderDetails.POS_OrderKey
	); 
   

SELECT
	CustomerId,
	customer_orders,
    avg_sale_cust_order,
    CASE
       WHEN avg_sale_cust_order >=(@AOV_all * 2) THEN "Key Account"
       WHEN  avg_sale_cust_order > @AOV_all THEN "Platinum"
       ELSE "Normal"
    END as Customer_Lvl
	FROM(
        SELECT
            CustomerId,
            customer_orders,
            FORMAT(customer_sales_val / customer_orders ,0) as avg_sale_cust_order
        FROM
        (
            SELECT 
                DISTINCT
                Customers.CustomerId,
                nOrders as customer_orders,
                SUM(OrderDetails.Sale)  OVER (PARTITION BY Customers.CustomerId ) as customer_sales_val
            FROM Customers
            LEFT JOIN Orders
            ON Customers.CustomerId = Orders.CustomerId
            LEFT JOIN OrderDetails
            ON Orders.POS_OrderKey = OrderDetails.POS_OrderKey
			WHERE Customers.CustomerId = _CustomerId_param
        ) as subq
) as subq2;

END$$

DROP PROCEDURE IF EXISTS `mostPopularProd_byYearNdCateg`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `mostPopularProd_byYearNdCateg` (IN `zProductCategory` VARCHAR(100), IN `Yearo` INT)  SELECT 
	ProductName,
    	most_popular
FROM
(
SELECT 
     Product.ProductName,
     SUM(OrderDetails.Qty) 
        OVER (PARTITION BY Product.ProductName) as most_popular
    FROM 
    ProductCategory
    LEFT JOIN ProductSubcategory
        ON ProductCategory.ProductCategoryID = ProductSubcategory.ProductCategoryID
    LEFT JOIN Product
        ON Product.ProductSubcategoryId = ProductSubcategory.ProductSubcategoryId
    LEFT JOIN OrderDetails
        ON OrderDetails.ProductId = Product.ProductId
    LEFT JOIN Orders
        ON Orders.POS_OrderKey = OrderDetails.POS_OrderKey
    WHERE  ProductCategory.ProductCategoryName = zProductCategory
    AND Year(Orders.ShipDate) = Yearo
)as subq
GROUP BY most_popular desc
LIMIT 1$$

DROP PROCEDURE IF EXISTS `mostProfitableProdState`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `mostProfitableProdState` (IN `zStateName` VARCHAR(100))  BEGIN 
    SELECT
        ProductName,
        yearo,
        SUM(Profit) as sum_profit
    FROM
    (
        SELECT
            Product.ProductName,
            Year(Orders.ShipDate) AS yearo,
            OrderDetails.Profit
        FROM
        State
        LEFT JOIN City
            ON State.StateId = City.StateId
        LEFT JOIN Customer
            ON Customer.CityId = City.CityId
        LEFT JOIN Orders 
            ON Customer.CustomerId = Orders.CustomerId
        LEFT JOIN OrderDetails
            ON Orders.POS_OrderKey = OrderDetails.POS_OrderKey
        LEFT JOIN Product
            ON OrderDetails.ProductId = Product.ProductId
        WHERE State.StateName = zStateName
    ) as subq
    GROUP BY 1,2
    ORDER BY sum_profit desc
    LIMIT 5;

END$$

DROP PROCEDURE IF EXISTS `mostProfitable_monthInYear`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `mostProfitable_monthInYear` ()  BEGIN
    SELECT
        yearo,
        montho,
        profito
    FROM
    (
    SELECT
        yearo,
        montho,
        profito,
        RANK() OVER(PARTITION by yearo ORDER BY profito desc) ranko
    FROM
    ( 
        SELECT
        YEAR(Orders.OrderDate) as yearo,
        MONTH(Orders.OrderDate) as montho,
        SUM(OrderDetails.Profit) as profito
    FROM Orders
    LEFT JOIN	OrderDetails
        ON Orders.POS_OrderKey = OrderDetails.POS_OrderKey
    GROUP BY 1,2
    )subq1
    ) subq2
    WHERE ranko = 1;

END$$

DROP PROCEDURE IF EXISTS `profitRatio_belowZero`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `profitRatio_belowZero` ()  BEGIN
    SELECT 
        *,
         IFNULL(FORMAT((Profit / Sale), 2),0) as ProfitRatio 
    FROM `OrderDetails`
    WHERE  IFNULL(FORMAT((Profit / Sale), 2),0) < 0;
END$$

DROP PROCEDURE IF EXISTS `totalProfitPerSegment`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `totalProfitPerSegment` ()  BEGIN
    SELECT
        ProductCategory.ProductCategoryName,
        CustomerSegment.CustomerSegmentName,
        SUM(OrderDetails.Profit) as sum_profit
    FROM ProductCategory
    LEFT JOIN ProductSubcategory
        ON ProductCategory.ProductCategoryId = ProductSubcategory.ProductCategoryID
    LEFT JOIN Product
        ON ProductSubcategory.ProductSubcategoryId = Product.ProductSubcategoryId
    LEFT JOIN OrderDetails
        ON OrderDetails.ProductId = Product.ProductId
    LEFT JOIN Orders
        ON Orders.POS_OrderKey = OrderDetails.POS_OrderKey
    LEFT JOIN Customer
        ON Customer.CustomerId = Orders.CustomerId
    LEFT JOIN CustomerSegment
        ON CustomerSegment.CustomerSegmentId = Customer.CustomerSegmentId
    GROUP BY 1,2 ;
END$$

DROP PROCEDURE IF EXISTS `totalRev_perVendor_segmentYear`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `totalRev_perVendor_segmentYear` ()  BEGIN
    SELECT
        DISTINCT
        Manufacturer.Manufacturer,
        YEAR(Orders.OrderDate) as yearo,
        CustomerSegment.CustomerSegmentName,
        SUM(OrderDetails.Sale)
     OVER (
        PARTITION BY 
            Manufacturer.Manufacturer,
            YEAR(Orders.OrderDate),
            CustomerSegment.CustomerSegmentName 
        ORDER BY YEAR(Orders.OrderDate)
    ) as total_rev
    FROM
    Manufacturer
    LEFT JOIN Product
        ON Manufacturer.ManufacturerID = Product.ManufacturerId
    LEFT JOIN OrderDetails
        ON Product.ProductId = OrderDetails.ProductId
    LEFT JOIN Orders
        ON OrderDetails.POS_OrderKey = Orders.POS_OrderKey
    LEFT JOIN Customer
        ON Customer.CustomerId = Orders.CustomerId
    LEFT JOIN CustomerSegment
        ON CustomerSegment.CustomerSegmentId = Customer.CustomerSegmentId ;
        
END$$

