DROP FUNCTION IF EXISTS `mostProfitableCity_byState_byYear`$$
CREATE DEFINER=`root`@`localhost` FUNCTION `mostProfitableCity_byState_byYear` (`statez` VARCHAR(200), `yearz` INT) RETURNS VARCHAR(100) CHARSET utf8mb4 BEGIN
    DECLARE 
    	cityProfit VARCHAR(100);
	SET 
    cityProfit = (
        SELECT CONCAT(CityName, ': ', profito)
        FROM 
        (
            SELECT
                CityName,
                yearo,
                SUM(total_profit) as profito
            FROM
            (
                SELECT
                City.CityName,
                YEAR(Orders.ShipDate) as yearo,
                OrderDetails.Profit as total_profit
                FROM 
                State
                LEFT JOIN City on State.StateId = City.StateId
                LEFT JOIN Customer ON City.CityId = Customer.CityId
                LEFT JOIN Orders ON Customer.CustomerId = Orders.CustomerId
                LEFT JOIN OrderDetails ON Orders.POS_OrderKey = OrderDetails.POS_OrderKey
                WHERE State.StateName = statez
            ) as subq
            WHERE yearo = yearz
            GROUP BY 1,2
            ORDER BY profito desc
            LIMIT 1
        ) as sub2
    );
    RETURN cityProfit;
END$$

